Forget your usual #pancakes, add ricotta and chocolate chips to make them so much better!

INGREDIENTS
200 g (¾ cup) yogurt;
100 g (⅘ cup) all-purpose flour;
1 egg;
120 ml (½ cup) milk;
40 g (½ cup) sugar;
10 g (2 tsp) baking powder;
a pinch of salt;
80 g (½ cup) chocolate chips.
METHOD
Whisk milk, yogurt, eggs, and sugar together.
Separately combine flour with baking powder and salt.
Add dry ingredients into the wet mixture, then mix to combine.
Finally, mix in chocolate chips and take a full ladle of the batter.
Cook each pancake until bubbly on the surface, then flip quickly and cook until brown.

